import unittest
from main import _mult, _sum,_min,_max
import time


class Test(unittest.TestCase):
    def test_returns_mult(self):
        self.assertEqual(_mult('datatest1.txt'), )# проверяем _mult

    def test_returns_sum(self):
        self.assertEqual(_sum('datatest1.txt'), 2598127) # проверяем _sum

    def test_returns_min(self):
        self.assertEqual(_min('datatest1.txt'),2) # проверяем _min

    def test_returns_max(self):
        self.assertEqual(_max('datatest1.txt'), 50) # проверяем _max
    def test_time_mult(self):
        # роверка _mult на скорость
        start1 = time.time()
        _mult('datatest1.txt')
        end1 = time.time()


        start2 = time.time()
        _mult('datatest2.txt')
        end2 = time.time()


        start3 = time.time()
        _mult('datatest3.txt')
        end3 = time.time()


        start4 = time.time()
        _mult('datatest4.txt')
        end4 = time.time()


        start5 = time.time()
        _mult('datatest5.txt')
        end5 = time.time()
        print('time for 100K numbers: ', end1 - start1)
        print('time for 200K numbers: ', end2 - start2)
        print('time for 300K numbers: ', end3 - start3)
        print('time for 400K numbers: ', end4 - start4)
        print('time for 500K numbers: ', end5 - start5)


if __name__ == "__main__":
    unittest.main()
